using namespace std;
using namespace std::chrono;

int compare(string str1,string str2)
{
    if(str1.length()>str2.length()) return 1;
    else if(str1.length()<str2.length())  return -1;
    else return str1.compare(str2);
}

//高精度加法
string add(string str1,string str2)//高精度加法
{
    string str;
    int len1=str1.length();
    int len2=str2.length();
    //前面补0，弄成长度相同
    if(len1<len2)
    {
        for(int i=1;i<=len2-len1;i++)
           str1="0"+str1;
    }
    else
    {
        for(int i=1;i<=len1-len2;i++)
           str2="0"+str2;
    }
    len1=str1.length();
    int cf=0;
    int temp;
    for(int i=len1-1;i>=0;i--)
    {
        temp=str1[i]-'0'+str2[i]-'0'+cf;
        cf=temp/10;
        temp%=10;
        str=char(temp+'0')+str;
    }
    if(cf!=0)  str=char(cf+'0')+str;
    return str;
}

int main()
{
     auto start = high_resolution_clock::now(); // 记录开始时间
     mpz_class p1(""), p2("");
     mpz_class n = p1 * p2;
     string str1 = "";
     string str2 = "";
     string r=add(str1,str2);
     mpz_class ad(r);
     mpz_class res(ad % n);
     cout<<res<<endl;
     auto stop = high_resolution_clock::now(); // 记录结束时间
     auto duration = duration_cast<nanoseconds>(stop - start); // 计算时间差
     cout << "Time:" << duration.count() << " ns" << endl; // 输出时间差
     system("pause");
     return 0;
}
